import React from 'react';
import Logo from "../../assets/img/png/react_logo_icon_144942.png";
import { Button } from "antd";
import { PoweroffOutlined, MenuUnfoldOutlined  } from '@ant-design/icons';
//import Icon from '@ant-design/icons';
import './MenuTop.scss';

export default function MenuTop(props) {
    const {menuCollapsed,setMenuCollapsed} = props;
    return (
        <div className="menu-top">
            <div className="menu-top__left">
                <img className="menu-top__left-logo"
                src={Logo}
                alt="Martin"
                />
                <Button type="link" onClick={()=>setMenuCollapsed(true)}>
                    <MenuUnfoldOutlined  type="menu-fold"/>
                </Button>
            </div>
            <div className="menu-top__right">
                <Button type="link">
                    <PoweroffOutlined/>
                </Button>
            </div>
        </div>
    );
}
